(3, NULL, 'What is Firewall?'),
(4, NULL, 'A firewall is software used to maintain the security of a private network. Firewalls block unauthorized access to or from private networks and are often employed to prevent unauthorized Web users or illicit software from gaining access to private networks connected to the Internet. A firewall may be implemented using hardware, software, or a combination of both.'),
(5, NULL, 'What is the purpose for Firewall?'),
(6, NULL, 'Packet Filtering: Firewalls filter packets that attempt to enter or leave a network and either accept or reject them depending on the predefined set of filter rules.,\r\nApplication Gateway: The application gateway technique employs security methods applied to certain applications such as Telnet and File Transfer Protocol servers.,\r\nCircuit-Level Gateway: A circuit-level gateway applies these methods when a connection such as Transmission Control Protocol is established and packets start to move.,\r\nProxy Servers: Proxy servers can mask real network addresses and intercept every message that enters or leaves a network.,\r\nStateful Inspection or Dynamic Packet Filtering: This method compares not just the header information, but also a packet’s most important inbound and outbound data parts. These are then compared to a trusted information database for characteristic matches. This determines whether the information is authorized to cross the firewall into the network.\r\n'),
(7, NULL, 'What is Proxy server?'),
(8, NULL, 'A proxy server is a server that sits between a client application, such as a Web browser, and a real server. It intercepts all requests to the real server to see if it can fulfill the requests itself. If not, it forwards the request to the real server.'),
(9, NULL, 'What is the purpose for Proxy server?'),
(10, NULL, 'Improve Performance. This is because it saves the results of all the requests for a certain amount of time. Instead of forwarding the request to the web server where the site resides, which is time-consuming operation, the proxy server simply returns the site that it already fetched for another user. Since the proxy server is often on the same network as the user. Real proxy servers support hundreds or thousands of users.,\r\nFilter Requests. For instance, a company might use a proxy server to prevent its employees from accessing a specific set of websites.\r\n');

